import React from "react";


function Song({ song }) {
  return (
    <div className='d-flex m-2 align-items-center'>
      <img src={song.albumUrl} style={{ height: '60px', width: '60px' }} />
      <div className="ml-3"></div>
      <p>{song.title}</p>
    </div>
  )
}

export default Song;
